//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.7;

contract Banking {

    /*
    TODO
    Hold a number of accounts and balances       []
    Deposit and withdraw money                   []
    Get the balance of the requesters account    [x]
    Write JS code to test the contract           []
     Optionally write web-app using web3.js      []
    */
/*
    address[3] public accounts;

    function generateAddresses(uint256 id) public returns (uint256) {
         require(id <= accounts.length); 
         accounts[id] = msg.sender;
         return id; 
    }

    function getAddresses() public view returns(address[3] memory) {
        return accounts;
    }

    function getBalance() public view returns (uint256) {
    return msg.sender.balance; 
}

    function deposit(uint256 amount) public payable {
    }
    */

    mapping(address => uint256) public balances; 

    function deposit() public payable {
        balances[msg.sender] += msg.value; 
    }

    function withdraw(uint256 amount) public {
        require(balances[msg.sender] >= amount, "Not enough Ether"); 
        balances[msg.sender] -= amount; 
        (bool sent,) = msg.sender.call{value: amount}("Sent"); 
        require(sent, "Failed to send Ether");
    }

    function getBalance() public view returns (uint256) {
    return msg.sender.balance; 
    }
}

